import React, { Component } from "react";

class CoLinkName extends Component {
  render() {
    return (
           <li className="coList" key={this.props.linkDataId}>
             <a className="linkCo" href="www">
               <span className="linkName">
                {this.props.linkDataName}
                {}
             </span>
             </a>
           </li>
    )
  }
}

export default CoLinkName;
